import styled, { css } from 'styled-components'
import { StyledProps } from '../Singleposts/SinglePost'
const EditDelete = () => {
  const Wrapper = styled.div`
    display: flex;
    flex-direction: row;
    font-size: 30px;
    align-items: center;
    justify-content: center;
    ${({ StyledProps }) => css`
      float: ${StyledProps.position};
    `}
  `
  return (
    <Wrapper>
      <i class='fa-regular fa-pen-to-square'></i>
      <i class='fa-regular fa-trash-can'></i>
    </Wrapper>
  )
}

export default EditDelete
